             col[i-1] = colors[j];\n                        j++;\n                    }else{col.push(\"#999999\");}\n                }\n                source.data.color = col;\n            }\n            if(b ===2){ //Nans\n                var temp = 0\n                max = Math.max(...data.nans)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * (1 - ((data.nans[i] + 1) / 19)));\n                    col.push(fullColorHex(temp, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"71c5950d-69d7-412b-aba6-580030af0d94","type":"CustomJS"},{"attributes":{},"id":"e43856dd-0dd5-4053-8b07-d4c1f8e20f14","type":"BasicTicker"},{"attributes":{"data_source":{"id":"f1dbbd2a-b120-46af-ae26-798b6bc0209f","type":"ColumnDataSource"},"glyph":{"id":"db2172d4-7dd8-4b86-a2fd-3d87fdad5c8c","type":"Circle"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"1473ede5-98d5-4061-967d-0b41f40e62e8","type":"Circle"},"selection_glyph":null,"view":{"id":"e90a1c40-5d8a-4887-8889-0911a6baf7a0","type":"CDSView"}},"id":"bca2cf8e-4ac2-493e-833f-66fc2ca35e70","type":"GlyphRenderer"},{"attributes":{},"id":"aab74636-d67c-41fa-aabe-956f4dc42268","type":"LinearScale"},{"attributes":{"plot":{"id":"0c73d565-1147-4d37-bb2b-0095637773f3","subtype":"Figure","type":"Plot"},"ticker":{"id":"670f7920-fffc-4d2a-80f5-2d0478acfbae","type":"BasicTicker"}},"id":"a284a799-0b63-4224-a4b6-efd1b083ec34","type":"Grid"},{"attributes":{"plot":null,"text":"Plot of the homology YKL
